import React from 'react';
import {Container} from 'react-bootstrap';
import "../../static/style.css";

const Footer = () => (
    <div>
    <footer class="footer">
   <Container fluid style={{backgroundColor:'#343a40', color:' #FFFFFF',padding:'30px 20px 20px'}}>
       <Container style={{display:'flex',justifyContent:'left',padding:'10px'}}>
         <p>Copyright © 2021 . all rights reserved.</p>  
       </Container>
   </Container>
   </footer>
   </div>
)

export default Footer;
